import{_ as e,c as i,a1 as r,o as n}from"./chunks/framework.BYvrwP48.js";const m=JSON.parse('{"title":"Retail AIO fixes","description":"","frontmatter":{},"headers":[],"relativePath":"wiki/error-fixes/retail/index.md","filePath":"wiki/error-fixes/retail/index.md"}'),t={name:"wiki/error-fixes/retail/index.md"};function o(s,a,l,d,c,p){return n(),i("div",null,a[0]||(a[0]=[r('<h1 id="retail-aio-fixes" tabindex="-1">Retail AIO fixes <a class="header-anchor" href="#retail-aio-fixes" aria-label="Permalink to &quot;Retail AIO fixes&quot;">​</a></h1><h2 id="crash-on-inject" tabindex="-1">Crash on inject <a class="header-anchor" href="#crash-on-inject" aria-label="Permalink to &quot;Crash on inject&quot;">​</a></h2><p>Retry once. Update Graphic Card drivers. Ask your GPU&#39;s compatibility in our discord server. Install DirectX 11, 12. Disable overlays (Nvidia, Discord). Lock ingame fps to 60 in lobby. Set Borderless in graphic settings instead of Fullscreen. After opening sewi.exe, quickly alt-tab back to the game window and stay there.</p><h2 id="initialization-error-driver-init-error" tabindex="-1">Initialization error (driver init error) <a class="header-anchor" href="#initialization-error-driver-init-error" aria-label="Permalink to &quot;Initialization error (driver init error)&quot;">​</a></h2><p>Go to BIOS. Disable Secure Boot and TPM Trusted Module. Disable Fast Boot. Disable Windows Defender and delete all antiviruses. Launch sewi.exe only as admin. Disable memory integrity. Disable Hyper V. Enable CPU Virtualization. Delete Valorant and Faceit. Open this file as admin and 3 times type yes and press enter in it (also known as windows 11 fix).</p><h2 id="crash-mid-game-during-warmup" tabindex="-1">Crash mid-game / during warmup <a class="header-anchor" href="#crash-mid-game-during-warmup" aria-label="Permalink to &quot;Crash mid-game / during warmup&quot;">​</a></h2><p>Lock FPS to 83 or below when hosting. Unlock it or change values only when playing (not hosting).</p><h2 id="_5fps-on-warzone-maps" tabindex="-1">5FPS on Warzone maps <a class="header-anchor" href="#_5fps-on-warzone-maps" aria-label="Permalink to &quot;5FPS on Warzone maps&quot;">​</a></h2><p>Type <code>exec br_core.cfg</code> into the command line and press apply (in lobby).</p><h2 id="infinity-waiting-loading-map" tabindex="-1">Infinity Waiting. Loading Map... <a class="header-anchor" href="#infinity-waiting-loading-map" aria-label="Permalink to &quot;Infinity Waiting. Loading Map...&quot;">​</a></h2><p>Reinstall maps from <a href="https://gofile.io/d/93KLzW" target="_blank" rel="noreferrer">https://gofile.io/d/93KLzW</a></p><p>Cold War and Vanguard Weapons:</p><h2 id="weapons-are-replaced-with-m4-and-1911" tabindex="-1">Weapons are replaced with M4 and 1911 <a class="header-anchor" href="#weapons-are-replaced-with-m4-and-1911" aria-label="Permalink to &quot;Weapons are replaced with M4 and 1911&quot;">​</a></h2><p>Press Load Scripts in lobby before starting match. Ensure that you have <code>script.gscbin</code> in your <code>Documents/Call of Duty Modern Warfare/scripts</code></p>',14)]))}const f=e(t,[["render",o]]);export{m as __pageData,f as default};
